import React from 'react';
import './App.css';
import pic from "../imgs/image-victor.jpg";

function App() {
  return (
    <main className="App">
      <div className="Card">
            <div className="card_header">
                <picture>
                    <img src={pic} alt="Victor" />
                </picture>
            </div>

        </div>
    </main>
  );
}

export default App;
